{'LL_response_content': 'Dear MK77,

Thank you for taking the time to review the Reveal Tight *Lattice Paisley 28". We stand behind the quality of our product, and we want to ensure that you're in gear that is performing well for you. I hear that this is not the case and would like to work with you to create a resolution. Keep your eyes peeled for an email headed your way so we can follow up and chat further.
Talk soon!', 'LL_response_date': 'January 18, 2019'}
